import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol, MDBBtn, MDBInput } from "mdbreact";
import { button } from "react-bootstrap";

class addproduct extends Component {
  constructor(props) {
    super(props);
  }

  checkUser() {
    try {
      var userType = JSON.parse(localStorage["token"]).login;
      if (userType === true) {
        return true;
      } else {
        return false;
      }
    } catch (e) {
      this.props.history.push("login");
    }
  }

  render() {
    return (
      <MDBContainer>
        <MDBRow>
          <MDBCol md="6">
            <form>
              <p className="h4 text-center mb-4">Add New Product</p>
              <label htmlFor="ProdName" className="grey-text">
                Product Name
              </label>
              <input type="text" id="Prodname" className="form-control" />
              <br />
              <label htmlFor="ProdQuantity" className="grey-text">
                Quantity
              </label>
              <input type="number" id="Prodquantity" className="form-control" />
              <br />
              <label htmlFor="Prodprice" className="grey-text">
                Product Price
              </label>
              <input type="number" id="Prodprice" className="form-control" />
              <br />
              <div className="text-center mt-4">
                <button type="submit" variant="outline-success">
                  Add Prod
                </button>
              </div>
            </form>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    );
  }
}

export default addproduct;
